(164, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:27:\"Portfolio Site Template Kit\";s:7:\"excerpt\";s:147:\"Get the COMPLETE Elementor portfolio template kit, including everything you need to create a beautiful WordPress website that attracts new clients!\";s:7:\"created\";s:10:\"1570012928\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:127:\"https://elementor.com/blog/portfolio-site-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:53:\"How to Secure Your WordPress Site: The Complete Guide\";s:7:\"excerpt\";s:244:\"WordPress is so beginner-friendly and easy to learn that many users often forget one crucial factor — security. In this article, we review the pros & cons of WordPress security in detail and provide the top tips for making your website safer.\";s:7:\"created\";s:10:\"1570005306\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/wordpress-security/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:51:\"Elementor Talks #48: Upscaling With Video Marketing\";s:7:\"excerpt\";s:243:\"Chris Savage, co-founder and CEO of Wistia, tells us how winning the Emmy awards propelled the development of Wistia, illustrates the role of videos as part of a content marketing strategy, and advises businesses to think like media companies.\";s:7:\"created\";s:10:\"1569477407\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/podcast-48-chris-savage/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:64:\"Introducing Pro Gallery: The Best Gallery Solution for WordPress\";s:7:\"excerpt\";s:146:\"Forget WordPress gallery plugins! Gain full control over your gallery design and enjoy the best responsive gallery for your website, and lets you \";s:7:\"created\";s:10:\"1569316235\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:123:\"https://elementor.com/blog/introducing-pro-gallery/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:53:\"How to Fix the White Screen When Editing in Elementor\";s:7:\"excerpt\";s:162:\"Learn how to diagnose the underlying problem that\'s causing the blank screen, as well as what steps you can take to fix the issue and get your site working again.\";s:7:\"created\";s:10:\"1568714976\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:107:\"https://elementor.com/blog/?p=30516&utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
