(442, 'dbem_bookings_email_pending_body', 'Cher/chère #_BOOKINGNAME,\r\n\r\nVous avez demandé à réserver #_BOOKINGSPACES place(s) pour #_EVENTNAME.\r\n\r\nQuand : #_EVENTDATES à #_EVENTTIMES\r\n\r\nOù : #_LOCATIONNAME - #_LOCATIONFULLLINE\r\n\r\nCette réservation est maintenant en attente d\'approbation par nos administrateurs : une fois approuvée vous recevrez un e-mail automatique de confirmation.\r\n\r\nCordialement,\r\n\r\n#_CONTACTNAME\r\n\r\n\r\n-------------------------------\r\n\r\nPowered by Events Manager - http://wp-events-plugin.com', 'yes'),
(443, 'dbem_bookings_email_rejected_subject', 'Réservation rejetée', 'yes'),
(444, 'dbem_bookings_email_rejected_body', 'Cher/chère #_BOOKINGNAME,\r\n\r\n\r\nVotre réservation pour#_BOOKINGSPACES place(s) pour #_EVENTNAME le #_EVENTDATES a été rejetée. \r\n\r\nCordialement,\r\n\r\n#_CONTACTNAME\r\n\r\n\r\n-------------------------------\r\n\r\nPowered by Events Manager - http://wp-events-plugin.com', 'yes'),
(445, 'dbem_bookings_email_confirmed_subject', 'Réservation confirmée', 'yes'),
(446, 'dbem_bookings_email_confirmed_body', 'Cher/chère #_BOOKINGNAME,\r\n\r\nVous avez réservé #_BOOKINGSPACES place(s) pour #_EVENTNAME.\r\n\r\nQuand : #_EVENTDATES à #_EVENTTIMES\r\n\r\nOù : #_LOCATIONNAME - #_LOCATIONFULLLINE\r\n\r\nCordialement,\r\n\r\n#_CONTACTNAME\r\n\r\n\r\n-------------------------------\r\n\r\nPowered by Events Manager - http://wp-events-plugin.com', 'yes'),
(447, 'dbem_bookings_email_cancelled_subject', 'Réservation annulée', 'yes'),
(448, 'dbem_bookings_email_cancelled_body', 'Cher/chère #_BOOKINGNAME,\r\n\r\nVotre réservation de #_BOOKINGSPACES place(s) pour #_EVENTNAME le #_EVENTDATES a été annulée.\r\n\r\nCordialement,\r\n\r\n#_CONTACTNAME\r\n\r\n\r\n-------------------------------\r\n\r\nPowered by Events Manager - http://wp-events-plugin.com', 'yes'),
(449, 'dbem_bookings_email_registration_subject', '[Feu d\'artifice] Vos nom d\'utilisateur et mot de passe', 'yes'),
(450, 'dbem_bookings_email_registration_body', 'Vous avez créé un compte sur Feu d\'artifice\r\n\r\nVous pouvez vous connecter sur notre site ici : http://localhost:8000/wp/wp-login.php\r\n\r\nNom d\'Utilisateur : : %username%\r\n\r\nMot de passe : %password%\r\n\r\nPour voir vos réservations, merci de vous rendre ici http://localhost:8000/?page_id=10 après vous êtes connectés au site.', 'yes'),
