(1, 1, '2019-09-24 14:45:31', '2019-09-24 12:45:31', '<!-- wp:paragraph -->\n<p>Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis commencez à écrire !</p>\n<!-- /wp:paragraph -->', 'Bonjour tout le monde !', '', 'publish', 'open', 'open', '', 'bonjour-tout-le-monde', '', '', '2019-09-24 14:45:31', '2019-09-24 12:45:31', '', 0, 'http://localhost:8000/?p=1', 0, 'post', '', 1),
(2, 1, '2019-09-24 14:45:31', '2019-09-24 12:45:31', 'L\'association S.E.P (Sonorisation éclairage pyrotechnique) est née en 2002, sous l\'impulsion d\'une équipe passionnée de pyrotechnie, de spectacle vivant et de sports nautiques. Au fil du temps, nous nous sommes imposés comme un acteur majeur dans la réalisation de spectacles pyrotechniques terrestres et nautiques. Notre capacité à concevoir des événements sur mesure et clé en main nous permet de proposer des œuvres originales, faisant appel à de nombreux domaines du spectacle. La création de nos propres produits de mise en scène et l\'utilisation de matériels à la pointe des dernières technologies apporte une dimension supplémentaire dans la réalisation de nos projets. A travers nos productions, nous souhaitons transmettre notre passion au public.\n<h1>Nos services étape par étape :</h1>\n<h1>1.</h1>\n<h1>Selection du site de tir</h1>\n<h1>2.</h1>\n<h1>Devis personnalisé</h1>\n<h1>3.&nbsp;</h1>\n<h1>Conception du feu</h1>\n<h1>4.</h1>\n<h1>Déclaration administrative</h1>\n<h1>5.</h1>\n<h1>Installation et tir du feu&nbsp;</h1>\n<h1>6.</h1>\n<h1>Enlevement des artifices</h1>\n<h2>Nous contacter</h2>\n[contact-form-7 id=\"29\" title=\"Formulaire de Contact\"]', 'Accueil', '', 'publish', 'closed', 'open', '', 'page-d-exemple', '', '', '2019-10-06 15:20:02', '2019-10-06 13:20:02', '', 0, 'http://localhost:8000/?page_id=2', 0, 'page', '', 0),
(5, 1, '2019-09-24 15:49:14', '2019-09-24 13:49:14', '<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nFeu d&#039;artifice \"[your-subject]\"\nFeu d&#039;artifice <maxime.kreber@gmail.com>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Feu d&#039;artifice (http://localhost:8000)\nmaxime.kreber@gmail.com\nReply-To: [your-email]\n\n0\n0\n\nFeu d&#039;artifice \"[your-subject]\"\nFeu d&#039;artifice <maxime.kreber@gmail.com>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Feu d&#039;artifice (http://localhost:8000)\n[your-email]\nReply-To: maxime.kreber@gmail.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2019-09-24 15:49:14', '2019-09-24 13:49:14', '', 0, 'http://localhost:8000/?post_type=wpcf7_contact_form&p=5', 0, 'wpcf7_contact_form', '', 0),
